const AdminSignUp = () => {
    
    const [details, setDetails] = useState({
        firstname: '',
        lastname: '',
        email: '',
        password: '',
      });
    
      const handleChange = (e) => {
        setDetails({
          ...details,
          [e.target.firstname]: e.target.value,
          [e.target.firstname]: e.target.value,
          [e.target.firstname]: e.target.value,
          [e.target.firstname]: e.target.value,
        });
      };
    
      const handleSignup = async () => {
        try {
          const response = await fetch('http://localhost:5000/signup', {
            method: 'POST',
            headers: {
              'Content-Type': 'application/json',
            }
           // body: JSON.stringify(credentials),
          });
    
          if (!response.ok) {
            const data = await response.json();
            throw new Error(data.message);
          }
    
          console.log('User registered successfully');
        } catch (error) {
          console.error('Signup Error:', error.message);
        }
      };
    
    
    
    
    
    
    return (
    <>
        <body className="form-body">
            <div>
                <h2 className="admin-singup">Admin Signup</h2>
                <p class="error"></p>
            </div>
        <div>
		    <div>
		    	<button id="try-it-free"><strong>Try it free 7 days</strong> then $20/mo. thereafter</button>
		    </div>
        
		    <div className="form-container">
		    	<form action="" method="GET">
                    <label htmlFor="firstname">
                    </label>
                    <input type="text" placeholder="First Name"/>
                    
                    <label htmlFor="lastname">
                    </label>
		    		<input type="text" placeholder="Last Name"/>
                    
                    <label htmlFor="email">
                    </label>
		    		<input type="email" placeholder="Email Address"/>
                    
                    <label htmlFor="password">
                    </label>
		    		<input name="password" type="password" placeholder="Password"/>
		    		<button type="SUBMIT" className="signup">Signup</button> 

		    		<h6>By clicking the button, you are agreeing to our <a href="#">Terms and Services</a></h6>
		    	</form>
		    </div>
	    </div>
        </body>
    </>
    )
}

export default AdminSignUp;
